import React from 'react';

/**
 * FIFOExplorer Component (Placeholder)
 * 
 * This component is integrated into TransactionTableEnhanced.js
 * The FIFO exploration happens when users expand transaction rows
 * to see the lots consumed for each disposal.
 * 
 * This file exists as a placeholder for potential future standalone FIFO visualization.
 */

const FIFOExplorer = ({ transactions }) => {
  return null; // FIFO details are shown in TransactionTableEnhanced
};

export default FIFOExplorer;
